    public double[] getSpeedAt(int col, int row) {
        int lowestCost = 1000000001;
        int lowestRow = 0;
        int lowestCol = 0;
        int searchDist = 8;
        for (int col2 = col - searchDist; col2 <= col + searchDist; col2++) {
            for (int row2 = row - searchDist; row2 <= row + searchDist; row2++) {
                if (row2 < 0 || col2 < 0 || row2 >= NUM_ROWS || col2 >= NUM_COLS) { // Don't leave the map
                    continue;
                }
                if (map[col2][row2].dist < lowestCost) {
                    lowestCost = map[col2][row2].dist;
                    lowestRow = row2;
                    lowestCol = col2;
                }
            }
        }
        double speedCol = lowestCol - col;
        double speedRow = lowestRow - row;
        // Normalize speeds so that one of them is always at full speed
        double higherVal = Math.max(Math.abs(speedCol), Math.abs(speedRow));
        if (higherVal != 0) {
            speedCol /= higherVal;
            speedRow /= higherVal;
        }
        double[] ret = {speedCol, speedRow, (map[col][row].canSeeTarget ? 1.0 : 0.0)};
        return ret;
    }

