    public void generateMap() {
        map[TARGET[0]][TARGET[1]].dist = 0;
        int lastK = 0;
        int oldK = 0;
        while (true){
            long startLoopTime = System.nanoTime();
            ArrayList<Search> toSearch = new ArrayList<Search>();
            int k = 0;
            for (int i = 0; i < needsSearch.length; i++){
                if (needsSearch[i] == null) continue;
                if (needsSearch[i].dist == 1000000000 || needsSearch[i].searched) continue;
                needsSearch[i].searched = true;
                k++;
                toSearch.add(new Search(needsSearch[i], map, mask));
            }
            if (k == 0 && lastK == 0){
                break;
            }else if (k == 0 && oldK != 0){//to check if done. might not be needed
                for (int i = 0; i < map.length; i++){
                    for (int j = 0; j < map.length; j++){
                        map[i][j].searched = false;
                    }
                }
            }
            oldK = lastK;
            lastK = k;
            for (Search thread : toSearch){
                thread.run();//replace with start when ready
            }
            /*while (true){
                boolean searchDone = true;
                for (Search thread : toSearch){
                    if(thread.isAlive()){
                        searchDone = false;
                    }
                }
                try{
                  Thread.sleep(50);
                  }catch (Exception e){
                  System.out.print(e);
                  }
                if (searchDone) break;
            }*/
            System.out.print("new loop SIZE: ");
            System.out.print(lastK + " in " + ((System.nanoTime() - startLoopTime) / 1000) + " microseconds\n");
        }
    }


